import { Users, Code, BrainCircuit } from "lucide-react";

export default function About() {
  return (
    <div className="max-w-5xl mx-auto mt-12 p-8 bg-white rounded-lg shadow-lg border border-gray-300">
      <h1 className="text-center text-primary text-2xl font-bold">About Our Project</h1>
      <p className="text-center text-gray-600 mt-2">AI-ML based Intelligent De-Hazing and De-Smoking Algorithm</p>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mt-8">
        {[
          { icon: <Users className="h-12 w-12 text-accent" />, title: "Team & Research", description: "Our project is developed by a team of final-year students, focused on AI and ML research." },
          { icon: <Code className="h-12 w-12 text-accent" />, title: "Technology Used", description: "We leverage deep learning models including U-Net, GANs, and Transformer-based approaches." },
          { icon: <BrainCircuit className="h-12 w-12 text-accent" />, title: "Future Scope", description: "Enhancing real-time video processing for traffic monitoring and security applications." }
        ].map((item, index) => (
          <div key={index} className="card flex flex-col items-center">
            {item.icon}
            <h3 className="mt-4 text-lg font-semibold">{item.title}</h3>
            <p className="text-gray-700 text-sm text-center">{item.description}</p>
          </div>
        ))}
      </div>

      <div className="text-center mt-10">
        <button className="btn-primary">Learn More</button>
      </div>
    </div>
  );
}
